//import lib
import React from 'react';
import myUniversity from '../../api/myUnivesity';
import UserCardList from '../StudentCardList';

// create a component 
class Student extends React.Component{

    constructor(props){
        super(props)

        this.state = {
            users: []
        }
        console.log('constructor')
    }

    fetchUsers = async() =>{
        console.log('fetch before')
       const response = await myUniversity.get('/secretary/studente');
       console.log('state')
       this.setState({users: response.data});
       console.log(response);
       console.log('fetch')
    }

    async componentDidMount(){
        console.log('mount before')
        this.fetchUsers();
        console.log('mount after')
    }

    render(){
        console.log('render')
        return (
            <main role='main' className='container'>
                <UserCardList users={this.state.users}/>
            </main>
        );
    }
}

//export a component
export default Student;
